import React, { useEffect, useState } from 'react';
import axios from 'axios';
import notebookjs from 'notebookjs';

function NotebookViewer() {
  const [notebookHtml, setNotebookHtml] = useState('');

  useEffect(() => {
    // Assume your .ipynb file is located at public/notebook.ipynb
    axios.get('/notebook.ipynb').then(response => {
      const notebook = notebookjs.parse(response.data);
      const html = notebook.render().outerHTML;
      setNotebookHtml(html);
    });
  }, []);

  return (
    <div dangerouslySetInnerHTML={{ __html: notebookHtml }} />
  );
}

export default NotebookViewer;
